import React, { useState } from "react";
import { Routes, Route, Link, Navigate } from "react-router-dom";
import Login from "./components/Login";
import Register from "./components/Register";
import Reserve from "./components/Reserve";

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  const handleLoginSuccess = () => {
    setIsAuthenticated(true);
  };

  return (
    <div>
      <h1>Welcome to Cloud Project</h1>
      <nav>
        {!isAuthenticated ? (
          <Link to="/login">Login</Link>
        ) : (
          <>
            <Link to="/reserve">Reserve</Link>
            <br />
            <Link to="/register">Register</Link>
          </>
        )}
      </nav>
      <Routes>
        <Route path="/login" element={<Login onLoginSuccess={handleLoginSuccess} />} />
        {isAuthenticated && <Route path="/register" element={<Register />} />}
        {isAuthenticated && <Route path="/reserve" element={<Reserve />} />}
        <Route path="/" element={<Navigate to={isAuthenticated ? "/reserve" : "/login"} replace />} />
      </Routes>
    </div>
  );
};

export default App;
